import React from 'react';


const ModalOver = (props) => {
    return (
        <Modal show="true">
            <Modal.Header closeButton>
                <Modal.Title>{props.title}</Modal.Title>
            </Modal.Header>
            <Modal.Body>{props.content}</Modal.Body>
        </Modal>

    );


}

export default ModalOver;
